import React from "react";

import "./Sidebar.css";
import NoteLayout from "./NoteLayout";

const Sidebar = (props) => {
  return (
    <aside class="sidebar">
      <button type="button" class="button block tertiary header-text">
        Create Note
      </button>
      <ul>
        {props.notes.map((existingNotes) => (
          <li className="active">
            <h3 className="header-text no-margin">{props.header}</h3>
            <p className="body-text no-margin muted">{props.timestamp}</p>
          </li>
        ))}
        {/* <li class="active">
